import { useEffect, useState } from "react";
import { fetchStays, fetchFoods } from "../api/api";
import StayCard from "../components/StayCard";
import FoodCard from "../components/FoodCard";

const Listings = () => {
  const [stays, setStays] = useState([
    {
      _id: 1,
      name: "Luxury Resort",
      image: "/stay-1.jpg",
      location: "Goa",
      price: "$150/night",
    },
    {
      _id: 2,
      name: "Cozy Cottage",
      image: "/stay-2.jpg",
      location: "Manali",
      price: "$100/night",
    },
    {
      _id: 3,
      name: "Beachfront Villa",
      image: "/stay-3.jpg",
      location: "Kerala",
      price: "$200/night",
    },
  ]);

  const [foods, setFoods] = useState([
    {
      _id: 1,
      name: "Pizza",
      image: "/food-1.jpg",
      cuisine: "Italian",
      price: "$12",
    },
    {
      _id: 2,
      name: "Sushi",
      image: "/food-2.jpg",
      cuisine: "Japanese",
      price: "$15",
    },
    {
      _id: 3,
      name: "Biryani",
      image: "/food-3.jpg",
      cuisine: "Indian",
      price: "$10",
    },
  ]);

  useEffect(() => {
    fetchStays().then((res) => setStays(res.data));
    fetchFoods().then((res) => setFoods(res.data));
  }, []);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Stay Listings</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        {stays.map((stay) => (
          <StayCard key={stay._id} stay={stay} />
        ))}
      </div>

      <h2 className="text-2xl font-bold mt-6 mb-4">Food Listings</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        {foods.map((food) => (
          <FoodCard key={food._id} food={food} />
        ))}
      </div>
    </div>
  );
};

export default Listings;
